export const getTest = async () => {
    try {
        const res = await fetch('http://localhost:8080/test', {
            method: 'GET',
            headers: {
                Accepts: 'application/json',
                'Content-Type': 'application/json',
            },
        });
        return await res.json();
    } catch (err) {}
}
